import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六丁日丁未时断</p><p>六丁日生时丁未，火托木局生有气；衣禄安稳且如常，运见水兮方得地。</p><p>丁日丁未时，火托木局，丁以甲为印绶，未为木库印绶之乡，若柱不见财星，不行财运，月年通亥卯未局，有倚托者，安稳之福。</p><p>丁丑日丁未时，丑未刑冲，不得善终。</p><p>年月辰戌，四库全，贵当极品。</p><p>申未，三品，法司淡薄清闲。</p><p>丁卯日丁未时，刑中发。</p><p>寅卯月，印绶，发财敦厚。</p><p>辰戌申午，俱吉。</p><p>丁巳日丁未时，拱禄格贵。</p><p>年有子字，则午为阙门，得拱大贵。</p><p>忌空亡填实。</p><p>年月见财官印，俱吉；财，富；官印，贵。</p><p>丁未日丁未时，八专太旺，早克父母妻子，衣禄平常，为僧道吉。</p><p>柱通金水木并金水运，衣禄安稳，大贵。</p><p>丁酉日丁未时，日贵格。</p><p>若亥卯未寅月生，衣禄敦厚，寅月，金水运，金紫风宪。</p><p>丁亥日丁未时，卯月，三合印局，贵而有寿，申，财官旺；亥，官旺，俱吉，夏生，丁火有气，儒官，但不免孤贫。</p><p>二丁相遇未时排，险路中年发福来；运吉贵人相会合，安闲衣禄不须猜。</p><p>丁日时逢丁未，其中仓库沈埋。</p><p>少年难发等时来，丑未相冲通泰。</p><p>不靠双亲雁侣，花开收果妻财。</p><p>时逢寿足福重来，末遇荣华堪快。</p>",23),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","210卷 八·六丁日丁未时断.html.vue"]]);export{f as default};
